  useEffect(() => {
    axios.get('http://localhost:3000/')
      .then((response) => {
        setData(response.data)
      })
      .catch((error) => {
        console.log(error)
      })
  }, [])

  console.log(response.data)
  return (
    <div>
      <p>{data}</p>
    </div>
  )
}

export default App
